import React, { useContext } from "react";
import { JobContext } from "./JobsContext";

function Home(props) {
  const [loadedJobs, setLoadedJobs] = useContext(JobContext);

  const text = loadedJobs.map((job) => {
    console.log(job.title);
  });
  return (
    <div>
      <ul>{text}</ul>
    </div>
  );
}

export default Home;
